export default (function(a,b,c,d,e,f,g,h){return {data:{EWHz17p4BD:{data:{id:2678,attributes:{imdbId:"tt1403865",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BODhkZDIzNjgtOTA5ZS00MmMzLWFkNjYtM2Y2MzFjN2FkNjAzL2ltYWdlXkEyXkFqcGdeQXVyNTAyODkwOQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.6\u002F10"},{Source:"Rotten Tomatoes",Value:"95%"},{Source:"Metacritic",Value:"80\u002F100"}],item_lang:{data:{id:3341,attributes:{title:a,plot:"Following the murder of her father by hired hand Tom Chaney, 14-year-old farm girl Mattie Ross sets out to capture the killer. To aid her, she hires the toughest U.S. marshal she can find, a man with \"true grit,\" Reuben J. \"Rooster\" Cogburn. Mattie insists on accompanying Cogburn, whose drinking, sloth, and generally reprobate character do not augment her faith in him. Against his wishes, she joins him in his trek into the Indian Nations in search of Chaney. They are joined by Texas Ranger LaBoeuf, who wants Chaney for his own purposes. The unlikely trio find danger and surprises on the journey, and each has his or her \"grit\" tested.",slug:"true-grit"}}},books:{data:[{id:12811,attributes:{title:a,description:e,thumbnail:f,authors:[c],firstBook:true,published:g,publisher:h,subtitle:b}},{id:12812,attributes:{title:a,description:"Pursuing a murderer who has escaped into Indian Territory, U.S. Marshal Rooster J. Cogburn teams up with a bounty-hunting Texas Ranger and Mattie Ross, a cantankerous young lady who is bent on revenge. U.S. marshal, Rooster Cogburn was hired by Mattie to kill the man who murdered her father and stole the family nest egg. She insists on accompanying Cogburn on his quest.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OQ93jgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2016-05-17",publisher:"Amulet Books",subtitle:"Young Readers Edition"}},{id:12813,attributes:{title:a,description:"Pursuing a cunning murderer who has escaped with his band deep into Indian Territory, U.S. Marshal Rooster J. Cogburn teams up with a bounty-hunting Texas Ranger and Mattie Ross, a cantankerous young lady who is bent on revenge.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=sNqcPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2007-08-28",publisher:"Harry N. Abrams",subtitle:b}},{id:12814,attributes:{title:a,description:b,thumbnail:b,authors:[c],firstBook:d,published:"2004-01-01",publisher:b,subtitle:"A Novel"}},{id:12815,attributes:{title:a,description:e,thumbnail:f,authors:[c],firstBook:d,published:g,publisher:h,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940903394}}("True Grit","","Charles Portis",null,"There is no knowing what lies in a man's heart. On a trip to buy ponies, Frank Ross is killed by one of his own workers. Tom Chaney shoots him down in the street for a horse, $150 cash, and two Californian gold pieces. Ross's unusually mature and single-minded fourteen-year-old daughter Mattie travels to claim his body, and finds that the authorities are doing nothing to find Chaney. Then she hears of Rooster - a man, she's told, who has grit - and convinces him to join her in a quest into dark, dangerous Indian territory to hunt Chaney down and avenge her father's murder.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=As-3gDwNNPwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-01-14","A&C Black"))